import classes from './MealItemForm.module.css';
import Input from '../../UI/Input';


const MealItemForm = (props) =>{

    return(

        <form className={classes.form}>

            <Input label="Enter state"
            input={{
                id:"state",
                type:"text",
                label:"Enter state"
            }}
            ></Input>
            <Input label="Cases" input={{
                id:"amount",
                type: "number",
                min:'1',
                max:'100',
                step:'1',
                defaultValue:'0',
            }}/>
             <Input label="Number of samples" input={{

                       id:"samples",
                       type: "number",
                       min:'1',
                       max:'100',
                       step:'1',
                      defaultValue:'0',
            }}/>
                        <Input label="No. of positive case" input={{
                         id:"positive",
                       type: "number",
                       min:'1',
                       max:'100',
                       step:'1',
                      defaultValue:'0',
            }}/>
                        <Input label="No. of negative case" input={{
                    id:"negative",
                    type: "number",
                    min:'1',
                    max:'100',
                    step:'1',
                   defaultValue:'0',
            }}/>
                        <Input label="Discharge" input={{
                    id:"discharge",
                    type:"number",
                    label:"Discharge"
            }}/>
                        <Input label="death" input={{
                id:"death",
                type:"number",
                label:"death"
            }}/>
            {/* <button>Add</button> */}
        </form>
    )}

export default MealItemForm;
